import {create} from "zustand/index";
import {ProductType, ShortProduct} from "../../models/Product.ts";
import {ProductForSelect} from "../../models/ProductForSelect.ts";

export type ProductState = {
    products: ShortProduct[];
    productsForSelect: ProductForSelect[];
}


const initialState: ProductState = {
    products: [{
        name: "Жека",
        type: ProductType.Guitar,
        image: "",
        price: 100,
        actualPrice: 76,
        sale: {
            id: "",
            percentage: 24,
        }
    },
        {
        name: "Guitar",
        type: ProductType.Guitar,
            image: "",
        price: 100,
        actualPrice: 76,
        sale: undefined
    }],
    productsForSelect: [
        {
            type: ProductType.Guitar,
            count: 10,
            enabled: false
        }
    ]
}

/*type CombinedProductsAction = {
}*/

const reducer = (state: ProductState): ProductState => {
    return {...state}
}

const useProductsStore = create<ProductState & { dispatch: () => void }>((set) => ({
    products: initialState.products,
    productsForSelect: initialState.productsForSelect,
    dispatch: () => set((state) => reducer(state))
}));


export { useProductsStore };